  \"Vocal Anuran Community Monitoring with Automatic Recording Devices at Mattamuskeet
  National Wildlife RefugenSummary Report 2015\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-10-22T17:46:21.634153\",\n\t\"name\": \"vocal-anuran-community-monitoring-with-automatic-recording-devices-at-mattamuskeet-nationa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During 2015, the Southeast Region Inventory
  and Monitoring Branch conducted the first-ever, pilot vocal anuran monitoring project
  at Mattamuskeet National Wildlife Refuge. Amphibians have been recognized as important
  indicators for environmental health. Many refuges in the South Atlantic ecoregion
  lack baseline data for amphibians.The methodology and data analysis were conducted
  in accordance with the National Park Service Southeast Coast Network Inventory and
  Monitoring Branchu2019s protocol for monitoring vocal anuran communities. Twelve
  Wildlife Acoustic SM2+ automatic recording devices (ARDs) were deployed from March
  18 u2013 June 4. Ten species were detected with the ARDs. The southern leopard frog
  (Lithobates sphenocphalus), bullfrog (Lithobates catesbieanus), cricket frog (Acris
  spp) and toads (Bufo spp.) had the highest frequency of occurrences and relative
  abundances followed by spring peeper (Pseudacris crucifer), green frog (Lithobates
  clamitans) and eastern narrow-mouthed toad(Gastrophyrne carolinesnsis). The carpenter
  frog (Lithobates virgatipes) had the lowest frequency of occurrence rate and relative
  abundance. This monitoring provides a new tool for refuges to collect baseline data
  on vocal anurans on a refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
